import React, { Component } from 'react';
import './App.css';

class Card extends Component {
    render() {
        // console.log(this.props.q)
        return(
            <div className="card">
            {this.props.q.map(question => {
                return (
                <>
                <div key={question.text}>{question.text}</div>
                <button>True</button>
                <button>False</button>
                </>
            )})}
            </div>
        )
    }
}

export default Card;
